import LogoImg from './image/Logo.png';

function Logo() {
    return (
        <>
            <p>오늘의 나를 담아 내일로,</p>
            <img src={LogoImg} alt='로고 fullio' width='352px' height='78px'></img>
        </>
    )
}

export default Logo;
